import React from "react";
import "./Caption.css";

export default function Caption() {
  return (
    <div className="Caption">
      <p>
        <i>
          above: visualization of computer vision word classification system{" "}
        </i>{" "}
        <br />
        <br />
        <span>
          {" "}
          <large>
            {" "}
            .upload <br />
            .trace <br />
            .tag <br />
          </large>
        </span>
      </p>
    </div>
  );
}
